        [HttpGet]
        [Route("/api/getlogdata")]
        public IActionResult GetCivilIDLogData()
        {
            var querystrins = Request.QueryString;



            var draw = Request.Query["draw"];
            var start = Request.Query["start"];
            var length = Request.Query["length"];
            ////var sortColumn = Request.Form["columns[" + Request.Form["order[0][column]"].FirstOrDefault() + "][name]"].FirstOrDefault();
            ////var sortColumnDirection = Request.Form["order[0][dir]"].FirstOrDefault();
            var searchValue = Request.Query["search[value]"].ToString();
            int pageSize = Convert.ToInt32(length);
            int skip = Convert.ToInt32(start);
            int recordsTotal = 0;
            //var customerData = (from tempcustomer in context.Customers select tempcustomer);
            //if (!(string.IsNullOrEmpty(sortColumn) && string.IsNullOrEmpty(sortColumnDirection)))
            //{
            //    customerData = customerData.OrderBy(sortColumn + " " + sortColumnDirection);
            //}


            string jsonStr = getJson();
            var obj = JsonSerializer.Deserialize<CivilIDLogDataPaginationObj>(jsonStr);
            var customerData = obj.data;

            if (!string.IsNullOrEmpty(searchValue))
            {
                customerData = customerData.Where(m => m.Country.ToLower().Contains(searchValue)).ToList();
            }


            recordsTotal = customerData.Count();
            var data = customerData.Skip(skip).Take(pageSize).ToList();
            var jsonData = new { draw = draw, recordsFiltered = recordsTotal, recordsTotal = recordsTotal, data = data };
            return Ok(jsonData);





            //return Ok(obj);
        }

